CREATE TABLE public.tbl_wood_mine_config (
    id bigint NOT NULL,
    name integer,
    level bigint,
    wood bigint,
    stone bigint,
    gold bigint,
    upgrade_duration bigint,
    gp_point_reward bigint,
    system_status integer DEFAULT 0 NOT NULL,
    metadata oid,
    created_at timestamp without time zone,
    updated_at timestamp without time zone,
    research_level_required bigint,
    max_worker bigint,
    wood_per_worker double precision
);


